import React from "react";
import {FaGithub} from "react-icons/fa";
import './ProjectsStyles.css'
import {useState} from "react"

function Projects() {
    // const button = document.querySelector("div description")
    // console.log(button)

    const [isVisisble, setIsVisible] = useState("false");
    
    return (
        <div id="list">
            <h1>Projects</h1>
            <div id="box">
                <div classname="project-card">
                    <img classname="proj" src=""></img>
                    <div classname="description">
                        <input id="projButton" type="button" value="Online Auction System" onClick={() => setIsVisible(!isVisisble)}>
                        {isVisisble ? console.log("true") : console.log("false")}
                        </input>
                        <a href="https://github.com/JuanAracena/OnlineAuctionSystem"><FaGithub size="4em"/></a>
                    </div>
                </div>
                
            </div>
        </div>
    )
}

export default Projects
